def parse_domain_name(url):
    if url.startswith(''):
        url = url[4:]
    url = re.sub(':\\d+', '', url)
    match = re.search('([a-zA-Z0-9-]+\\.[a-zA-Z0-9-.]+)', url)
    if match:
        domain_name = match.group(1)
        if re.search('[^a-zA-Z0-9.-]', domain_name):
            return 'Invalid URL'
        return domain_name
